import axios from "axios";
import React, { useState } from "react";

import './SignUp.css';


const SignUp = () => {

  const [data, updateData] = useState({
    fname: "",
    lname: "",
    email: "",
    pass: ""
  })

  const enteringData = (data) => {
    const { value, name } = data.target

    updateData((previousData) => {
      return {
        ...previousData,
        [name]: value
      }
    })



  }

  const saveData = (event) => {
      event.preventDefault();


    console.log(data)
    const jsonuser = JSON.stringify(data)
    console.log(jsonuser)
    // const user = new FormData(jsonuser)

    const url = "http://localhost:80/instaprint_backend/signup.php";
    axios.post(url, jsonuser)
      .then(() => {
        console.log("DATA SEND")
      }).catch(() => {
        console.log("ERROR")
      })

  }


  return (
    <>
      <div>
        <div2>
          <form action="" onSubmit={saveData}>
            <span className="login">SIGN UP</span>
            <p1>Create a new account</p1>


            <span className="logi">FIRST NAME<span2> * </span2></span>
            <input
              type="text"
              name="fname"
              onChange={enteringData}
              placeholder="Entre your FIRST NAME"
            />


            <span className="logi">LAST NAME <span2> * </span2></span>

            <input
              type="text"
              name="lname"
              onChange={enteringData}
              placeholder="Entre your LAST NAME"
            />

            <span className="logi">EMAIL ADREESS <span2> * </span2></span>
            <input
              type="email"
              name="email"
              onChange={enteringData}
              placeholder="Entre your Email"
            />


            <span className="logi">PASSWORD <span2> * </span2></span>

            <input
              type="password"
              name="pass"
              onChange={enteringData}
              placeholder="Entre your password"
            />

            <p1>Password Strength: No Password</p1>


            <span className="logi"> CONFIRM PASSWORD <span2> * </span2></span>

            <input
              type="password"
              placeholder="Plz confirm your password"
            />

            <div4><input className="width" type="checkbox" />  <p1>SIGN UP FOR NEWSLATTER</p1></div4>
            <input type="submit" className="btn1" value="SIGN UP" />
          </form>
        </div2>
      </div>
    </>
  );
};

export default SignUp;
